import React from 'react';
import classes from './Header.module.css';

const Header = () => {
    return (
        <header className={classes.header}>
            <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Fx-icon-changer.ru.aptoide.com%2Fapp&psig=AOvVaw1fT_Er-Z-76fbVZuDwdEaD&ust=1608388702934000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCIin2__g1-0CFQAAAAAdAAAAABAD'  alt="Logo"/>
        </header>
    );
}

export default Header;
